    // data.map(user =>  <User user ={user} /> )


    const main = (
      <div className="container">
        <div className="row">
          {data.map(user => (
            <div key={user.id} className="card">
              <div className="card-body">{user.name}</div>
            </div>
          ))}
        </div>
      </div>
    );

